import React from 'react';
import styled from 'styled-components';
import logo from './assets/LOGO.png';
import homeIcon from './assets/home_icon.svg';
import reviewIcon from './assets/review_icon.svg';
import profileIcon from './assets/profile_icon.svg';

const App = () => {
  return (
    <Container>
      <Header>
        <TopBar>
          <Link href="#">회원가입</Link>
          <Link href="#">로그인</Link>
        </TopBar>
      </Header>

      <Main>
        <LogoContainer>
          <Logo src={logo} alt="Wine Tale Logo" />
          <Title>Wine Tale</Title>
        </LogoContainer>

        <SearchBar>
          <SearchInput type="text" placeholder="와인을 검색하세요..." />
          <SearchIcon>🔍</SearchIcon>
        </SearchBar>
      </Main>

      <Footer>
        <NavBar>
          <NavItem>
            <NavIcon src={homeIcon} alt="홈 아이콘" />
            <NavText>홈</NavText>
          </NavItem>
          <NavItem>
            <NavIcon src={reviewIcon} alt="리뷰 아이콘" />
            <NavText>내 리뷰</NavText>
          </NavItem>
          <NavItem>
            <NavIcon src={profileIcon} alt="프로필 아이콘" />
            <NavText>내 정보</NavText>
          </NavItem>
        </NavBar>
      </Footer>
    </Container>
  );
};

export default App;

// Styled Components
const Container = styled.div`
  font-family: Arial, sans-serif;
  display: flex;
  flex-direction: column;
  align-items: center;
  max-width: 600px;
  margin: 0 auto;
  min-height: 100vh;
  position: relative;
`;

const Header = styled.header`
  width: 100%;
  position: absolute;
  top: 0;
`;

const TopBar = styled.div`
  display: flex;
  justify-content: flex-end;
  padding: 10px;
  width: 100%;
`;

const Link = styled.a`
  margin-left: 10px;
  text-decoration: none;
  color: black;
  font-size: 16px;

  @media (max-width: 768px) {
    font-size: 14px;
  }
`;

const Main = styled.main`
  text-align: center;
  margin-top: 100px; /* Adjusted to avoid overlap with TopBar */
`;

const LogoContainer = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
`;

const Logo = styled.img`
  width: 100px;

  @media (max-width: 768px) {
    width: 80px;
  }

  @media (max-width: 480px) {
    width: 60px;
  }
`;

const Title = styled.h1`
  font-size: 24px;
  color: #333;
  margin-top: 10px;

  @media (max-width: 768px) {
    font-size: 20px;
  }

  @media (max-width: 480px) {
    font-size: 18px;
  }
`;

const SearchBar = styled.div`
  position: relative;
  width: 80%;
  max-width: 500px;
  margin: 20px;

  @media (max-width: 768px) {
    width: 90%;
  }
`;

const SearchInput = styled.input`
  width: 100%;
  padding: 10px 20px;
  border-radius: 25px;
  border: 1px solid #ccc;
  font-size: 16px;

  @media (max-width: 480px) {
    padding: 8px 15px;
    font-size: 14px;
  }
`;

const SearchIcon = styled.span`
  position: absolute;
  right: 15px;
  top: 50%;
  transform: translateY(-50%);
  font-size: 20px;
  color: #888;

  @media (max-width: 480px) {
    font-size: 18px;
  }
`;

const Footer = styled.footer`
  width: 100%;
  border-top: 1px solid #ccc;
  background-color: #f9f9f9;
  padding: 10px 0;
  position: absolute;
  bottom: 0;
`;

const NavBar = styled.div`
  display: flex;
  justify-content: space-between;
  width: 100%;
`;

const NavItem = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  color: #888;

  @media (max-width: 480px) {
    flex-direction: row;
    margin: 5px 0;
  }
`;

const NavIcon = styled.img`
  width: 24px;
  height: 24px;
  margin-bottom: 5px;

  @media (max-width: 768px) {
    width: 20px;
    height: 20px;
  }

  @media (max-width: 480px) {
    width: 18px;
    height: 18px;
    margin-right: 5px;
  }
`;

const NavText = styled.span`
  font-size: 14px;

  @media (max-width: 768px) {
    font-size: 12px;
  }
`;
